import React from "react";

function Login() {
  return (
    <div>

    <form action="/login">
        <label>hi</label>
        <input placeholder="USERNAME" name="username" type="text" />
        <input placeholder="PASSWORD" name="password" type="password" />
        <button type="button" class="btn btn-outline-success">
          Login
        </button>
      </form>
    </div>
  );
}
export default Login;
